import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import './App.css';
import Login from './components/login';

function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Rout expect path = '/'> 
            <Login />
          </Rout>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
